import React from 'react';
import {
    Navbar,
    Container
 } from 'react-bootstrap';

class NavBar extends React.Component {
    render() {
        const NavStyle = {
            background: '#D6B064',
            height: '85px',
        }
        return (
            <Navbar style={NavStyle} >
                <Container>
                    <Navbar.Brand>
                        <img>
                            src="../DialexaBVGMain"
                        </img>
                    </Navbar.Brand>
                </Container>
            </Navbar>
        );
    }
}

export default NavBar;
